import React from "react";
import { NavLink } from "react-router-dom";
import "./ComponentSearch.css";

export default function ComponentSearch() {
  return (
    <>
      <div className="form-import-container">
        <div className="form-import-content">
          <div className="form-import">
            <div className="title-content">
              <div className="title">
                <h2>THÊM THÔNG TIN SINH VIÊN</h2>
                <p>Chú ý (*) </p>
              </div>
              <div className="body-text">
                <div className="body-text-router">
                  <NavLink to="/" style={{ color: "#fff" }}>
                    Thêm thông tin
                  </NavLink>
                  <NavLink
                    className="active-router"
                    to="/FormSearch"
                    style={{ color: "#fff" }}
                  >
                    Tra cứu thông tin
                  </NavLink>
                </div>
                {/* <div className="body-text-input">
                <div className="input-info">
                  <span></span>
                  <input></input>
                </div>
              </div> */}
              </div>
            </div>
            <div className="body-content">
              <div className="mb-3">
                {/* <input
                  className="form-control"
                  type="file"
                  id="formFile"
                  onChange={(e) => {
                    setSeclectFie(e.target.files[0]);
                  }}
                /> */}
              </div>

              {/* <input
                type="file"
                onChange={(e) => {
                  setSeclectFie(e.target.files[0]);
                }}
              ></input> */}
              {/* <button className="sumit-form-import" onClick={fileSelect}>
                    Import
                </button> */}
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
